CREATE TABLE IF NOT EXISTS symfony_demo_user (id INTEGER PRIMARY KEY AUTO_INCREMENT NOT NULL, full_name VARCHAR(255) NOT NULL, username VARCHAR(255) NOT NULL, email VARCHAR(255) NOT NULL, password VARCHAR(255) NOT NULL, roles TEXT NOT NULL
);
CREATE TABLE IF NOT EXISTS symfony_demo_tag (id INTEGER PRIMARY KEY AUTO_INCREMENT NOT NULL, name VARCHAR(255) NOT NULL);


CREATE TABLE IF NOT EXISTS symfony_demo_post ( id INT PRIMARY KEY AUTO_INCREMENT NOT NULL, author_id INT NOT NULL, title VARCHAR(255) NOT NULL, slug VARCHAR(255) NOT NULL, summary VARCHAR(255) NOT NULL, content TEXT NOT NULL, published_at DATETIME NOT NULL, CONSTRAINT FK_58A92E65F675F31B FOREIGN KEY (author_id) REFERENCES symfony_demo_user (id) ON UPDATE RESTRICT ON DELETE RESTRICT );






CREATE TABLE IF NOT EXISTS symfony_demo_post_tag (post_id INTEGER NOT NULL, tag_id INTEGER NOT NULL, PRIMARY KEY(post_id, tag_id), CONSTRAINT FK_6ABC1CC44B89032C FOREIGN KEY (post_id) REFERENCES symfony_demo_post (id) ON DELETE CASCADE, CONSTRAINT FK_6ABC1CC4BAD26311 FOREIGN KEY (tag_id) REFERENCES symfony_demo_tag (id) ON DELETE CASCADE);



CREATE TABLE IF NOT EXISTS symfony_demo_comment (id INTEGER PRIMARY KEY AUTO_INCREMENT NOT NULL, post_id INTEGER NOT NULL, author_id INTEGER NOT NULL, content TEXT NOT NULL, published_at DATETIME NOT NULL, CONSTRAINT FK_53AD8F834B89032C FOREIGN KEY (post_id) REFERENCES symfony_demo_post (id), CONSTRAINT FK_53AD8F83F675F31B FOREIGN KEY (author_id) REFERENCES symfony_demo_user (id));
CREATE INDEX IDX_58A92 ON symfony_demo_post (author_id);
CREATE INDEX IDX_6ABC1 ON symfony_demo_post_tag (post_id);
CREATE INDEX IDX_6ABC2 ON symfony_demo_post_tag (tag_id);
CREATE UNIQUE INDEX 4D585 ON symfony_demo_tag (name(250));
CREATE UNIQUE INDEX 8FB09 ON symfony_demo_user (username(250));
CREATE UNIQUE INDEX 8FB07 ON symfony_demo_user (email(250));
CREATE INDEX IDX_53AD8 ON symfony_demo_comment (post_id);
CREATE INDEX IDX_53AD9 ON symfony_demo_comment (author_id);

